commits.content:
.button {
  background: linear-gradient(
    to right,
    var(--light-blue-color) 0%,
    var(--button-blue-color) 22%,
    var(--dark-blue-color) 74%,
    var(--reddish-pink-color) 100%
  );
  color: var(--white-color);
  border: none;
  cursor: pointer;
  font-size: 16px;
  justify-self: center;
  border-radius: 15px;
  height: 50px;
}
/* Personalized Colors */
.gray {
  background: var(--button-gray);
  padding: 15px 30px;
}

.login {
  min-height: 10px;
  background: var(--purple-color);
}

.more {
  height: fit-content;
  /* min-height: 10px; */
  background: var(--purple-color);
}
